import React, { useState } from 'react';
import HeadPage from '../components/head'
import Navbar from '../components/navbar/index'
import {  
    Jumbotron,
    Button, 
} from 'reactstrap';

import 'bootstrap/dist/css/bootstrap.min.css';

function HomePage() {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);
    return (
        <div>
            <HeadPage/>
            <Navbar/>
               

            <Jumbotron fluid className="descr-top">
                <Container className="text-center">

                <h1 className="display-3">Seu Catálogo de Alimentos Veganos, Vegetarianos e Sem Glúten</h1>
                <p className="lead">Verifique se o alimento é Vegano, Vegetariano e se possúi Glúten</p>
                <hr className="my-2" />
                <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
                <p className="lead">
                    <Button color="success" size="lg">Acesse</Button>
                </p>
                </Container>
            </Jumbotron>

        </div>

    )
}

export default HomePage
